methods.comment:
Replaces substring tags in a source StringsCarrier with string values from the object. 

Searches a source StringsCarrier for instances of moustache tags matching the object&amp;apos;s keys, and replaces them with the associated string values.

Object&amp;apos;s keys will be moustached prior to comparison, wrapped with double open and double close curly braces: {{key}}

